import React from "react";
import {
  AppBar,
  Toolbar,
  CssBaseline,
  Typography,
} from "@mui/material";

import { Link } from "react-router-dom";


function Navbar() {

  return (
    <AppBar position="static">
      <CssBaseline />
      <Toolbar>
        <Typography variant="h4">
          Perotti Pet Pavillion
        </Typography>
          <div >
            <Link to="/" >
              Petshop Home
            </Link>
            <Link to="/addPet" >
              Add A Pet
            </Link>
            <Link to="/faq" >
              FAQ
            </Link>
          </div>
      </Toolbar>
    </AppBar>
  );
}
export default Navbar;
